  if fn == null
    fn = @(a, b) {
      a > b
    }

  
  for $i in 1..length(list) - 1
    for $j in 0..$i - 1
      if fn(list[$j], list[$i])
        $temp = list[$i]
        list[$i] = list[$j]
        list[$j] = $temp
  return list

  sort('e' 'c' 'f' 'a' 'b' 'd')
  

  sort(5 3 6 1 2 4, @(a, b){
    a < b
  })

